import PropTypes from 'prop-types';
import styles from './PersonPhoto.module.css';

const PersonPhoto = ({personPhoto, personName}) => {
    return (
        <>
            {typeof personName}
            {typeof personPhoto}
            <img src={personPhoto} alt={personName}/>
        </>
    );
}

PersonPhoto.propTypes = {
    // personPhoto: PropTypes.
    // personName: PropTypes.
